import { Formik } from 'formik';
import { add } from 'lodash';
import React, { useState } from 'react';

const SimpleFormik = () => {
    
    const [initialValues, setInitialValues] =useState({
        title: "",
        description: ""
    });

    return(
        <Formik
            initialValues={initialValues}
            validate={values => {return;}}
            onSubmit={(values) => {return;}}
        >
            {({}) => (
                <div>
                    <h1>Simple Formik</h1>
                    <form>
                        <label>Title:
                            <input
                            type="text"
                            id="title"
                            name="title"
                            />
                        </label>
                        
                        <br></br>
                        <label>Description:
                            <input 
                            type="text"
                            id="description"
                            name="description"
                            />
                        </label>
                        <br></br>
                        <button type="submit">Submit</button>
                    </form>
                </div>
            )}
        </Formik>
        
    )
}

export default SimpleFormik;
